import React from 'react';
import styled from 'styled-components';
import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Content = () => {
  return (
    <Wrapper>
      <Banner>
        <h3>Set 7 Update is now live on TFTactics!</h3>
        <a>Click here to learn more</a>
      </Banner>
      <Container>
        <Row>
          <Col lg={3} style={{ padding: 0 }}>
            <Filter>
              <FilterTitle>
                <h4>Filters</h4>
                <ResetButton className='btn'>Reset</ResetButton>
              </FilterTitle>
              <div className='divider'></div>
              <FilterLists>
                <FilterList>Playstyle</FilterList>
                <FilterList>Origin</FilterList>
                <FilterList>Class</FilterList>
              </FilterLists>
            </Filter>
          </Col>
          <Col lg={9} style={{ padding: 0 }}>
            <TierList>
              <TierListTitle>
                <h4>TFT Meta Team Comps Tier List</h4>
              </TierListTitle>
              <div className='divider'></div>
              <TierListInfo>
                <div>
                  <InfoItem>Patch 12.11</InfoItem>
                </div>
                <div className='d-flex'>
                  <InfoItem>
                    <div className='info-item-up'>▴</div>
                    Tier Up
                  </InfoItem>
                  <InfoItem>
                    <div className='info-item-down'>▾</div>
                    Tier Down
                  </InfoItem>
                  <InfoItem>
                    <div className='info-item-new'>N</div>
                    New
                  </InfoItem>
                </div>
              </TierListInfo>
            </TierList>
          </Col>
        </Row>
      </Container>
    </Wrapper>
  );
};

export default Content;

const Wrapper = styled.div`
  max-width: 1200px;
  width: 90%;
  margin: 0 auto;

  padding-top: 50px;
`;
const Banner = styled.a`
  height: 100px;
  background-image: url(https://rerollcdn.com/update/set-7-update-bg.png);
  cursor: pointer;
  margin-bottom: 40px;

  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  transition: all 0.3s;
  border: 1px solid #0d202b;

  &:hover {
    border: 1px solid #227aad;

    & a {
      color: #2689c2;
    }
  }

  & h3 {
    color: rgba(255, 255, 255, 0.9);
    margin-bottom: 3px;
  }

  & a {
    color: #579dd4;
    font-size: 16px;
    font-weight: 500;
    transition: all 0.3s;
  }
`;

const Filter = styled.div`
  padding-right: 0px;
  & h4 {
    color: #fff;
    font-size: 21px;
  }
`;

const FilterTitle = styled.div`
  display: flex;
  justify-content: space-between;
`;
const TierList = styled.div`
  padding-left: 0px;
`;
const TierListTitle = styled.div`
  & h4 {
    color: #fff;
    font-size: 21px;
  }
`;
const TierListInfo = styled.div`
  display: flex;
`;
const InfoItem = styled.div`
  margin-left: 10px;
  border-radius: 3px;
  background: #123040;
  padding: 5px 10px 5px 5px;
  font-weight: 400;
  color: #88a0a7;
  height: 35px;

  display: flex;
  align-items: center;
  justify-content: center;

  & .info-item-up {
    color: #bfff7f;
    font-size: 24px;
    margin-right: 5px;
  }
  & .info-item-down {
    color: #ff7f7f;
    font-size: 24px;
    margin-right: 5px;
  }
  & .info-item-new {
    color: #ffdf7f;
    font-size: 12px;
    font-weight: 700;
    margin-right: 5px;
  }
`;

const ResetButton = styled.button``;

const FilterLists = styled.div``;
const FilterList = styled.div``;
